import React from 'react';

const MovieInfo = props => (
    <div className="text-center">
    <img 
        alt={props.title}
        className="img-fluid"
        src={props.src}
        style={{ margin: "0 auto"}} />
        <h3>Director(s): {props.director}</h3>
        <h3>Release Date: {props.released}</h3>
        <h3>Genre: {props.genre}</h3>
    </div>
);

export default MovieInfo;
